import { Box } from '@mui/material'
import React from 'react'
import HomeMenu from './HomeMenu/HomeMenu'
// import Select from '../SelectButton/SelectButton'

const home = [
    'Home',
    'Best Offers',
    'up-coming offers',
    'new products',
    'best sell',
    'Mobiles',
    'laptops',
    'smart watches'
]

function SubHeader() {

    return (
        <Box sx={{
            width: '100%',
            pt: 11.3
        }}>
            <Box sx={{
                bgcolor: 'lightgrey',
            }}>
                <HomeMenu prop={home} type={'Home'} />
            </Box>
        </Box>
    )
}

export default SubHeader
